import React from "react";

export default class ModuleListComponent extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      module: {
        id: -1,
        titile: ""
      }
    };
  }

  render() {
    return (
      <div>
        <div className="list-group">
          {modules.map(module => (
            <a
              key={module.id}
              href={`/courses/${course.id}/modules/${
                module.id
              }/lessons/1/topics/1`}
              className="list-group-item"
            >
              {module.title}
              <i className="fa fa-trash" />
            </a>
          ))}
        </div>
      </div>
    );
  }
}
